"original": |2-
     When receiving a SETUP request, the server determines if the media
     resource is available and if one or more of the of the transport
     parameter specifications are acceptable.  If that is successful, an
     RTSP session context is created and the relevant parameters and state
     is stored.  An identifier is created for the RTSP session and
     included in the response in the Session header (Section 18.49).  The
     SETUP response includes a Transport header that specifies which of
     the alternatives has been selected and relevant parameters.
"fixed": |-
  When receiving a SETUP request, the server determines if the media resource is available and if one or more of the of the transport parameter specifications are acceptable.  If that is successful, an RTSP session context is created and the relevant parameters and state is stored.  An identifier is created for the RTSP session and included in the response in the Session header (Section 18.49).  The SETUP response includes a Transport header that specifies which of the alternatives has been selected and relevant parameters.
"ko": |-
  SETUP 요청을 수신하면 서버는 미디어 리소스가 사용 가능한지, 전송 매개변수 사양 중 하나 이상이 허용되는지 여부를 결정합니다. 성공하면 RTSP 세션 컨텍스트가 생성되고 관련 매개변수 및 상태가 저장됩니다. RTSP 세션에 대한 식별자가 생성되고 세션 헤더의 응답에 포함됩니다(18.49절). SETUP 응답에는 선택된 대안과 관련 매개변수를 지정하는 전송 헤더가 포함되어 있습니다.
